Description:
{'plain': "Premier extrait de l'album de Jul Dans ma paranoïa disponible depuis le 24 février 2014.

Ce single a été diffusé pour la première fois lors d'un freestyle.
https://www.youtube.com/watch?v=C-4CWdC6Y6Y"}

{'plain': "Ce morceau est le premier sorti officiellement depuis le conflit entre Jul et son ex-label, Liga One Industry.

Le rappeur a publié un communiqué sur son compte Facebook, expliquant que les deux se sont quittés en bons termes, et qu'il a créé son propre label, “D'or et de platine”.

https://www.facebook.com/julOfficial/posts/717656661669719"}

{'plain': "Morceau égotrip dans lequel Jul revient sur le début de sa carrière et sur sa façon de s'en sortir. On retrouve tout de même ses thèmes habituels : le quartier, le monde de la musique, ses habitudes et même son enfance.

Ce son peut faire référence à la fois au titre “Entrer dans la légende” d'Akhenaton, autre rappeur marseillais et membre du groupe IAM ; ou alors au morceau “Dans la légende” d'un autre groupe marseillais : la Fonky Family, que Jul évoque assez souvent en interview ou dans ses textes, en la personne de Le Rat Luciano.

Petit j’écoute Luc’, Booba, Rohff"}

{'plain': "Sur ce son, Jul nous parle d'une fille qui profite, qui n'est attirée que par l'argent et qui arrive à mener les garçons en bateau.

Comme dans d'autres de ses titres (Señora, Tu la love, Lova), Jul met en garde contre les filles matérialistes (voire vénales) et qui se mettent trop en avant physiquement.

Cette chanson est certifié single de platine en France par le SNEP."}

{'plain': "Jul explique que pour cette personne, il ferait tout au point d'aller décrocher une étoile pour elle. Ainsi, Jul parle de sa mère.

Ce son n'est paru dans aucun de ses albums.

C'est un remix de Formidable de Stromae."}

{'plain': "Dans ce morceau, il se confie sur ses fréquentations, sur le quartier et son atmosphère qui invite à la violence et à la surenchère.
Il regrette que les choses se passent ainsi, mais il n'est pas haineux, ni même en colère, juste amer.

Le morceau a une ambiance mélancolique, qui colle bien au texte nostalgique."}

{'plain': "“La Tête Dans Les Nuages”  est le premier extrait de l'album du même nom de Jul dont la sortie est prévue début décembre.

Le single est sorti le 23 octobre 2017 sur les plateformes de streaming au moment où Jul était en garde à vue à Marseille.

Il s'agit d'un morceau où Jul dédicace beaucoup de personnes qu'il juge dans des situations compliquées."}

{'plain': "“Ne M'en Voulez Pas” est le 16ème extrait de My World.

Jul exprime ses remords, ainsi que ses objectifs et les sacrifices qu'il a dû faire pour arriver où il en est.
Il espère pouvoir quitter le quartier, où tous les jours se passent des drames."}

{'plain': "“Pour Les Taulards” est le 8ème morceau de My World.

Comme le titre l'indique, c'est un hommage à ses amis en prison, et aux incarcérés en général.

Dans chaque couplet, il décrit le scénario complet, de la vie avant la prison d'un personne, puis son arrestation, le tribunal et enfin la prison."}

{'plain': "“Comme les gens d'ici” est le 9ème titre de l'album “La tête dans les nuages”, de Jul.

Ce son a été produit et écrit par Jul, comme une bonne partie des sons de l'artiste. Cependant, on peut y trouver des similitudes avec le morceau “La Lettre” de Renan Luce, notamment dans le flow, qui laisseraient penser qu'il s'en est inspiré.
https://www.youtube.com/watch?v=7Vv5sDQ9aFU"}

{'plain': 'Quatrième piste de l’album.
L’intégralité du morceau fait référence au personnage Silene Olivera dite «\xa0Tokyo\xa0» de la célèbre série La Casa de Papel.

Les personnage de la série portent tous un nom de ville pour rester anonyme.'}

{'plain': "http://www.youtube.com/watch?v=TZYRe-WSvtw




Ce morceau est repris d'un freestyle fait à Skyrock au moment de la sortie de son album “Je Trouve Pas Le Sommeil”.

https://www.youtube.com/watch?v=7SLnC5JTWNo"}

{'plain': "Ce son très planant peut être assimilé à de la cloud trap. Le gimmick répété en fond tout au long de la chanson peut rappeler celui de la chanson “Ella, elle l'a” de France Gall.

https://youtu.be/lgHGU8gqz9U

A savoir que Jul s'est souvent inspiré de chansons populaires notamment pour “Mon son vient d'ailleurs”, “Encore des paroles” avec Julie Gonzalez, “Self Control (Ma Life 2)” et bien sûr “My World”."}

{'plain': "Neuvième morceau du quatrième album gratuit de Jul.

Parfum Quartier est un jeu de mots entre le quartier et le parfum de la marque de luxe  Cartier.

Le 21 août 2020, soit deux ans et onze mois après sa sortie, le morceau est certifié single d'or en France par le SNEP. Puis le 19 mai 2022, il perçoit la certification de single de platine en cumulant plus de 30 000 000 de streams."}

{'plain': "Quelques semaines après la sortie de la compilation marseillaise 13 Organisé dans laquelle JuL et SCH ont collaboré à cinq reprises, “Mother Fuck” est leur premier titre en duo. Il est également le premier extrait de l'album Loin du monde. Le morceau est très attendu puisqu'il rassemble deux des grandes stars du rap des années 2010, considérées par certains comme faisant partie des meilleurs rappeurs français. Issus de la même région, ce featuring sonnait comme une évidence depuis plusieurs années mais il a fallu attendre jusqu'en décembre 2020 pour enfin le voir apparaître.

Le morceau est officialisé la veille de sa sortie via un court extrait vidéo sur les réseaux sociaux. Le titre fait référence au gimmick bien connu de SCH “mathafack”, scandé dans le refrain.

Le 21 juillet 2022, le morceau est certifié single de diamant en France par le SNEP, en cumulant plus de 50 000 000 de streams."}

{'plain': '“Être bleu” est une expression qui signifie “être ivre”.

J'me mets bleu sous rosé
Jul\xa0—\xa0"En Y"'}
